void fft_core32(complex32 *x, complex32 *w, int nstride, int nfft)
{
    int i, ig, j, k, l, ngroups, nbutterflies;          // 32.0
    complex32 ctemp;                                    // 1.31

//----- Bit Reverse Section -----------------------------------------------

    j = 0;
    for (i=0; i<nfft-1; i++)
    {
        if (i<j)
        {
            ctemp.re = x[j].re;
            ctemp.im = x[j].im;

            x[j].re = x[i].re;
            x[j].im = x[i].im;

            x[i].re = ctemp.re;
            x[i].im = ctemp.im;
        }

        k = nfft >> 1;

        while (k <= j)
        {
            j -= k;
            k = k >> 1;
        }
        j += k;
    }

    //----- First Stage -------------------------------------------------------

    i = 0;
    j = 1;
    ngroups = nfft >> 1;

    for (ig=0; ig<ngroups; ig++)
    {
        ctemp.re = x[j].re;
        ctemp.im = x[j].im;

        x[j].re = x[i].re - ctemp.re;
        x[j].im = x[i].im - ctemp.im;

        x[i].re = x[i].re + ctemp.re;
        x[i].im = x[i].im + ctemp.im;

        i = i + 2;
        j = j + 2;
    }

    //----- Final log2(nfft)-1 Stages -----------------------------------------

    nbutterflies = 2;

    for (ngroups = nfft >> 2; ngroups > 0; ngroups >>= 1)
    {
        i = 0;
        j = nbutterflies;

        for (ig=0; ig<ngroups; ig++)
        {
            k = 0;
            for (l=0; l<nbutterflies; l++)
            {
                // Butterfly
                ctemp.re = (int32_t) (((((int64_t)x[j].re * w[k].re) >> 32)
                          - (((int64_t)x[j].im * w[k].im) >> 32)) << 1);
                ctemp.im = (int32_t) (((((int64_t)x[j].im * w[k].re) >> 32)
                          + (((int64_t)x[j].re * w[k].im) >> 32)) << 1);

                x[j].re = x[i].re - ctemp.re;
                x[j].im = x[i].im - ctemp.im;

                x[i].re = x[i].re + ctemp.re;
                x[i].im = x[i].im + ctemp.im;

                k += (ngroups << nstride);
                i++;
                j++;
            }

            i = i + nbutterflies;
            j = j + nbutterflies;
        }
        nbutterflies <<= 1;
    }
}

